import React from 'react';
const axios = require('axios');

const fetchUser = () => {
    axios.get('https://jsonplaceholder.typicode.com/users')
        .then((response: any) => console.log(response.data))
        .catch((error: any) => console.log(error));
}
export default fetchUser
